						<div itemprop="articleBody">
		<p style="text-align: center;"><strong>Indkaldelse til Årsmøde i Danske Kvindelige Lægers Forening</strong></p>
<p style="text-align: center;"><strong>Torsdag d. 26. april 2012</strong></p>
<p style="text-align: center;"><strong>Kl. 17.00-ca. 18.15</strong></p>
<p style="text-align: center;"><strong>Auditoriet, Hovedvejen, Indgang 14</strong></p>
<p style="text-align: center;"><strong>Frederiksberg Hospital</strong></p>
<p style="text-align: center;"><strong>Ndr. Fasanvej 57, 2000 Frederiksberg </strong></p>
<p><strong>&nbsp;</strong></p>
<p>På grund af ombygning af auditoriebygningen på Gentofte Hospital afholdes årsmødet, takket været hjælp fra overlæge Bente Danneskiold-Samsøe, i år på ovenstående adresse.</p>
<p>1. &nbsp;Velkomst v. Agnete Basbøll</p>
<p>2. &nbsp;Uddeling af Agnethe Løvgreens Legat v. Kirsten Salado - Rasmussen</p>
<p>3. &nbsp;Indlæg af årets 3 legatmodtagere, som kort vil præsentere deres projekter</p>
<p><span style="white-space: pre;">4.&nbsp; Nyt fra Myanmar. April Moe, som netop er hjemvendt fra Myanmar vil fortælle om samarbejdet mellem KLF og </span></p>
<p><span style="white-space: pre;">&nbsp;&nbsp;&nbsp;&nbsp; Myanmar</span><span style="white-space: pre;">Medical Association Women section. </span></p>
<p>5.&nbsp; Status vedrørende Mentorordningen ved Maria Lip</p>
<p>Efterfølgende vil der være et let traktement, inden der afholdes Generalforsamling kl. 19.</p>
<p>Hellerup d. 20. april 2012</p>
<p>Agnete Basbøll</p>	</div>

	
